import React from "react";
function NewsArticle({ data }) {
  return (
    <div className="news">
      <a href={data.urlToImage}>
        <div className="news__image">
          <img src={data.urlToImage} atl="image" width="350" height="200" />
        </div>{" "}
      </a>{" "}
      <br />
      <h3 className="news__title">{data.title}</h3>
      <p className="news__desc">
        {data.description}{" "}
        <span className="news__url">
          {" "}
          {"\u00A0"} <a href={data.url}> Read More.. </a>{" "}
        </span>
      </p>
      <span className="news__author">
        Author: {"\u00A0"} {"\u00A0"} {data.author}
      </span>{" "}
      <br />
      <span className="news__published">
        Date Pub: {"\u00A0"} {data.publishedAt}
      </span>{" "}
      <br />
      <span className="news__source">
        Source: {"\u00A0"} {"\u00A0"} {"\u00A0"} {data.source.name}
      </span>{" "}
      <br />
    </div>
  );
}

export default NewsArticle;
